// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

// import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
// import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
// import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
// import "./SafeMath.sol";
import "./ERC20.sol";



contract TBILLToken is IERC20 {
    string public name = "TBILL Token";
    string public symbol = "TBILL";
    uint8 public decimals = 18;
    uint256 public override totalSupply;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    // Events
    // event Transfer(address indexed from, address indexed to, uint256 value);
    // event Approval(address indexed owner, address indexed spender, uint256 value);
    event Mint(address indexed to, uint256 value);
    event Burn(address indexed from, uint256 value);

    constructor(uint256 initialSupply) {
        totalSupply = initialSupply * (10 ** uint256(decimals));
        _balances[msg.sender] = totalSupply;
        emit Transfer(address(0), msg.sender, totalSupply);
    }

    function balanceOf(address account) external view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address to, uint256 value) external override returns (bool) {
        require(to != address(0), "ERC20: transfer to the zero address");
        require(_balances[msg.sender] >= value, "ERC20: insufficient balance");

        _transfer(msg.sender, to, value);
        return true;
    }

    function allowance(address owner, address spender) external view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 value) external override returns (bool) {
        _approve(msg.sender, spender, value);
        return true;
    }

    function transferFrom(address from, address to, uint256 value) external override returns (bool) {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(_balances[from] >= value, "ERC20: insufficient balance");
        require(_allowances[from][msg.sender] >= value, "ERC20: allowance exceeded");

        _transfer(from, to, value);
        _approve(from, msg.sender, _allowances[from][msg.sender] - value);
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal {
        _balances[sender] -= amount;
        _balances[recipient] += amount;
        emit Transfer(sender, recipient, amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal {
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    // Mint function
    function mint(address to, uint256 value) external {
        require(msg.sender == address(this), "Only the contract itself can mint tokens");

        totalSupply += value;
        _balances[to] += value;
        emit Mint(to, value);
        emit Transfer(address(0), to, value);
    }

    // Burn function
    function burn(uint256 value) external {
        require(_balances[msg.sender] >= value, "ERC20: insufficient balance");

        _balances[msg.sender] -= value;
        totalSupply -= value;
        emit Burn(msg.sender, value);
        emit Transfer(msg.sender, address(0), value);
    }

    function burnFrom(address account, uint256 value) external {
        require(account != address(0), "ERC20: burn from the zero address");
        require(_balances[account] >= value, "ERC20: insufficient balance");
        require(_allowances[account][msg.sender] >= value, "ERC20: allowance exceeded");

        _balances[account] -= value;
        totalSupply -= value;
        _approve(account, msg.sender, _allowances[account][msg.sender] - value);
        emit Burn(account, value);
        emit Transfer(account, address(0), value);
    }
}

